import React, { useState, useEffect } from 'react';
import { fetchGowns } from '../services/api';

const Collection = () => {
    const [gowns, setGowns] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await fetchGowns();
                setGowns(response.data); // Assuming API response contains gowns array
            } catch (error) {
                console.error('Error fetching gowns:', error);
            }
        };

        fetchData();
    }, []);

    return (
        <div>
            <h1>Collection</h1>
            {gowns.map((gown) => (
                <div key={gown.id}>
                    <h2>{gown.name}</h2>
                    <p>{gown.price}</p>
                </div>
            ))}
        </div>
    );
};

export default Collection;
